import React, { useState } from "react";
import data from "../data/data";
import classnames from "classnames";
import NotesPage from "./NotesPage";
import { TabContent, TabPane, Nav, NavItem, NavLink } from "reactstrap";

const MyTabNav = (props) => {
  const [activeTab, setActiveTab] = useState("0");

  const toggle = (tab) => {
    if (activeTab !== tab) setActiveTab(tab);
  };

  return (
    <div>
      <Nav tabs>
        {props.projectNames.map((project) => (
          <NavItem>
            <NavLink
              className={classnames({
                active:
                  activeTab === String(props.projectNames.indexOf(project)),
              })}
              onClick={() => {
                toggle(String(props.projectNames.indexOf(project)));
              }}
            >
              {project}
            </NavLink>
          </NavItem>
        ))}
      </Nav>

      <TabContent activeTab={activeTab}>
        <TabPane tabId={String(activeTab)}>
          {props.projectMap.forEach(function (project, projectName) {
            console.log(projectName);
            project.map((note) => {
              console.log(note);
              // <NotesPage
              //   noteText={note}
              //   noteTitle={projectName}
              //   noteType={"TEXT"}
              //   noteLink={"https://google.com"}
              // />;
              console.log(projectName);
            });
          })}
          {/* <NotesPage noteText={props.projectMap} noteTitle={props.projectNames[activeTab]} noteType={"TEXT"} noteLink={"https://google.com"} />)} */}
        </TabPane>
      </TabContent>
    </div>
  );
};

export default MyTabNav;
